        /// https://www.lix.polytechnique.fr/~nielsen/WEBvisualcomputing/programs/slerp.cpp
        // const dotProduct = this.x * other.x + this.y * other.y + this.z * other.z + this.w * other.w
        const dotProduct = this.dot(other);
