                // case 'struct': {
                //   let membersStr = ''
                //   if (trimmedLine.includes('}')) {
                //     membersStr = trimmedLine.substring(trimmedLine.indexOf('{') + 1, trimmedLine.indexOf('}') - 1)
                //   } else {
